import React from 'react';
import Navbar from '../components/Navbar';
import { useNavigate } from 'react-router-dom';

const Home = ({ username, handleLogout }) => {
  return (
    <div>
      <Navbar username={username} handleLogout={handleLogout} />
      <div className="flex flex-col items-center justify-center text-center mt-20">
        {/* Main Content */}
        <div>
          <h1 className="text-5xl font-bold text-gray-800 mb-4">Welcome!</h1>
          <p className="text-lg text-gray-600 mb-8">This is a basic template of a full-stack app.</p>
          <div className="space-y-4">
            <button onClick={() => navigate('/login')} className="block bg-blue-500 hover:bg-blue-600 text-white px-6 py-3 rounded-lg text-xl">Login</button>
            <button onClick={() => navigate('/register')} className="block bg-green-500 hover:bg-green-600 text-white px-6 py-3 rounded-lg text-xl">Register</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
